// styling
import "./index.css";
import "./Paths";
// react depenedencies
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// importing pages
import LandingPage from "./pages/LandingPage";
import About from "./pages/About";
import Contact from "./pages/Contact";
import Paths from "./Paths";
// import images
import profileImg1 from "./images/120s.jpeg.png";
import profileImg2 from "./images/120s.jpg";

function App() {
  const yelpData = [
    {
      name: "Tiffinay M.",
      location: "Atlanta, GA",
      date_created: "8/18/2021",
      image: { profileImg1 },
      comment:
        "Have been getting my taxes done here for years. They are professional and knowledgable, I have never had any issues.",
    },
    {
      name: "Najah H.",
      location: "Smyrna, GA",
      date_created: "3/9/2018",
      image: { profileImg2 },
      comment:
        "Al-Nisa S. Shaheed is a Sr. Tax Analyst and she’s been doing my taxes for years! They are a Black-owned business that guides you along the way for tax preparation. Thorough. Informative. Timely. Great customer service!!! Make your appointment today.",
    },
  ];
  return (
    <Router>
      <Routes>
        <Route
          exact
          path={Paths.home}
          element={<LandingPage yelpData={yelpData} Paths={Paths} />}
        />
        <Route exact path={Paths.about} element={<About />} />
        <Route exact path={Paths.contacts} element={<Contact />} />
      </Routes>
    </Router>
  );
}

export default App;
